	pie_plot . pie_data .= map pitem (values total lista)
		

percent :: Int -> Int -> Double
percent x y =   100 * ( b / a )
	where 
		  a = fromIntegral x :: Double
		  b = fromIntegral y :: Double



mediaD :: [Double] -> Double
mediaD ld = (sum ld) / s
	where
		  a = length ld
		  s = fromIntegral a :: Double



